    data: |
      SELECT DISTINCT + + col1 + - + 27 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 + - col1 + + col0 * + col2 * - 95 ) IN ( + col0, - ( + - col1 ) );
  - name: tab2

outputs:
  - name: q5092.out
    data: |
      24
      40
      50
